Verenigde Staten
Drama / Romantiek
108 minuten

een goeie film

met Channing Tatum, Amanda Seyfried en Henry Thomas

Een jonge soldaat John Tyree (Channing Tatum), is met verlof en wordt verliefd op de schitterende, maar conservatieve studente 
Savannah Lynn Curtis (Amanda Seyfried). De twee beleven een mooie tijd en wanneer John weer op uitzending gestuurd wordt, 
beloven ze elkaar brieven te schrijven om hun liefde levend te houden. Maar de lange afstand tussen beiden lijkt voor meer 
problemen te zorgen dan verwacht.
